package goDB

import (
	"bufio"
	"reflect"
	"testing"
)

var sanitizeUserInputTests = []struct {
	input  string
	output string
}{
	{"", ""},
	// Canonical forms remain unchanged
	{"dport != 80", "dport != 80"},
	{"dport = 80", "dport = 80"},
	{"dport < 80", "dport < 80"},
	{"dport <= 80", "dport <= 80"},
	{"dport > 80", "dport > 80"},
	{"dport >= 80", "dport >= 80"},
	{"dport >= 80 & dport >= 81", "dport >= 80 & dport >= 81"},
	{"dport >= 80 | dport >= 81", "dport >= 80 | dport >= 81"},
	{"! dport >= 80", "! dport >= 80"},
	// Conversion to lower case works
	{"dPoRt >= 80 | DPORT >= 81", "dport >= 80 | dport >= 81"},
	// Noncanonical forms of various operators are substituted
	{"dport ne 80||dport -ne 80 or dport neq 80+dport -neq 80", "dport!=80|dport!=80|dport!=80|dport!=80"},
	{"dport eq 80||dport -eq 80 or dport equals 80+dport==80+dport===80", "dport=80|dport=80|dport=80|dport=80|dport=80"},
	{"dport le 80||dport -le 80 or dport leq 80+dport -leq 80", "dport<=80|dport<=80|dport<=80|dport<=80"},
	{"dport ge 80&&dport -ge 80 and dport geq 80*dport -geq 80", "dport>=80&dport>=80&dport>=80&dport>=80"},
	{"dport l 80||dport -l 80 or dport l 80*dport -l 80", "dport<80|dport<80|dport<80&dport<80"},
	{"dport g 80&&dport -g 80 or dport g 80+dport -g 80", "dport>80&dport>80|dport>80|dport>80"},
	{"not dport g 80", "!dport>80"},
	{"dport<443& not{dport g 80}", "dport<443&!(dport>80)"},
	{"dport<443& not[dport g 80]", "dport<443&!(dport>80)"},
}

func TestSanitizeUserInput(t *testing.T) {
	for _, test := range sanitizeUserInputTests {
		sanitized, err := SanitizeUserInput(test.input)
		if err != nil {
			t.Fatalf("SanitizeUserInput unexpectedly failed on input %v. The error is: %s",
				test.input, err)
		}
		if test.output != sanitized {
			t.Fatalf("SanitizeUserInput returned an unexpected output. Expected output: %v. Actual output: %s",
				test.output, sanitized)
		}
	}
}

type splitFuncTest struct {
	inputData  []byte
	inputAtEof bool
	outAdvance int
	outToken   []byte
}

func testSplitFunc(t *testing.T, f bufio.SplitFunc, test splitFuncTest) {
	outAdvance, outToken, err := f(test.inputData, test.inputAtEof)
	if err != nil {
		t.Fatalf("Failed on input (%v, %v). The error is: %s",
			test.inputData, test.inputAtEof, err)
	}
	if !reflect.DeepEqual(test.outToken, outToken) {
		t.Fatalf("Data: '%s' AtEof: %v Output variable token: Expected output: %v. Actual output: %s",
			test.inputData, test.inputAtEof, test.outToken, outToken)
	}
	if test.outAdvance != outAdvance {
		t.Fatalf("Data: '%s' AtEof: %v Output variable advance: Expected output: %d. Actual output: %d",
			test.inputData, test.inputAtEof, test.outAdvance, outAdvance)
	}
	if !reflect.DeepEqual(test.outToken, outToken) {
		t.Fatalf("Data: '%s' AtEof: %v Output variable token: Expected output: %v. Actual output: %s",
			test.inputData, test.inputAtEof, test.outToken, outToken)
	}
}

var wordSplitFuncTests = []splitFuncTest{
	{[]byte(""), false, 0, nil},
	{[]byte(""), true, 0, nil},
	{[]byte("asd.123:ef/12"), false, 0, nil},
	{[]byte("a&"), false, 1, []byte("a")},
	{[]byte("a|"), false, 1, []byte("a")},
	{[]byte("a!"), false, 1, []byte("a")},
	{[]byte("a="), false, 1, []byte("a")},
	{[]byte("a<"), false, 1, []byte("a")},
	{[]byte("a>"), false, 1, []byte("a")},
	{[]byte("a "), false, 1, []byte("a")},
	{[]byte("asd.123:ef/12 "), false, 13, []byte("asd.123:ef/12")},
	{[]byte("asd.123:ef/12"), true, 13, []byte("asd.123:ef/12")},
	{[]byte("example.com "), false, 11, []byte("example.com")},
	{[]byte("foo-bar.example.com\n"), false, 19, []byte("foo-bar.example.com")},
}

func TestWordSplitFunc(t *testing.T) {
	for _, test := range wordSplitFuncTests {
		testSplitFunc(t, wordSplitFunc, test)
	}
}

var delimiterSplitFuncTests = []splitFuncTest{
	{[]byte(""), false, 0, nil},
	{[]byte(""), true, 0, nil},
	{[]byte("<"), false, 0, nil},
	{[]byte(">"), false, 0, nil},
	{[]byte("!"), false, 0, nil},
	{[]byte("&"), false, 1, []byte("&")},
	{[]byte("| "), false, 1, []byte("|")},
	{[]byte("=x"), false, 1, []byte("=")},
	{[]byte("(1"), false, 1, []byte("(")},
	{[]byte(")"), false, 1, []byte(")")},
	{[]byte(" "), false, 1, []byte(" ")},
	{[]byte("\t"), false, 1, []byte(" ")},
	{[]byte("\n"), false, 1, []byte(" ")},
	{[]byte("\r"), false, 1, []byte(" ")},
	{[]byte("<="), false, 2, []byte("<=")},
	{[]byte(">="), false, 2, []byte(">=")},
	{[]byte("!=="), false, 2, []byte("!=")},
	{[]byte("<"), true, 1, []byte("<")},
	{[]byte(">"), true, 1, []byte(">")},
	{[]byte("!"), true, 1, []byte("!")},
}

func TestDelimiterSplitFunc(t *testing.T) {
	for _, test := range delimiterSplitFuncTests {
		testSplitFunc(t, delimiterSplitFunc, test)
	}
}

func TestConditionalSplitFunc(t *testing.T) {
	for _, test := range wordSplitFuncTests {
		testSplitFunc(t, conditionalSplitFunc, test)
	}
	for _, test := range delimiterSplitFuncTests {
		testSplitFunc(t, conditionalSplitFunc, test)
	}
}

var TokenizeConditionalTests = []struct {
	input     string
	outTokens []string
}{
	{"dport = 80", []string{"dport", "=", "80"}},
	{"dport != 80", []string{"dport", "!=", "80"}},
	{"dport < 80", []string{"dport", "<", "80"}},
	{"dport <= 80", []string{"dport", "<=", "80"}},
	{"dport > 80", []string{"dport", ">", "80"}},
	{"dport >= 80", []string{"dport", ">=", "80"}},
	{"!dport >= 80", []string{"!", "dport", ">=", "80"}},
	{"!(dport >= 80)", []string{"!", "(", "dport", ">=", "80", ")"}},
	{"!\t(snet=\n192.168.0.0/22\r)\n", []string{"!", "(", "snet", "=", "192.168.0.0/22", ")"}},
	{"sip=127.0.0.1|dip=127.0.0.1", []string{"sip", "=", "127.0.0.1", "|", "dip", "=", "127.0.0.1"}},
	{"sip = 127.0.0.1 & dip = 127.0.0.1", []string{"sip", "=", "127.0.0.1", "&", "dip", "=", "127.0.0.1"}},
	{"sip = 2a00:db0:7:c08:e4d:e9ff:fea4:88e9 & dip = 2a00::e4d:e9ff:fea4:88e9", []string{"sip", "=", "2a00:db0:7:c08:e4d:e9ff:fea4:88e9", "&", "dip", "=", "2a00::e4d:e9ff:fea4:88e9"}},
	{"sip = 2a00:db0:7:c08:e4d:: & dip = 2a00::e4d:e9ff:fea4:88e9", []string{"sip", "=", "2a00:db0:7:c08:e4d::", "&", "dip", "=", "2a00::e4d:e9ff:fea4:88e9"}},
	{"sip = example.com.  & dip =sub-domain.open.ch", []string{"sip", "=", "example.com.", "&", "dip", "=", "sub-domain.open.ch"}},
	// TokenizeConditional also tokenizes incorrect conditionals. It's the parser's job to catch those.
	{"dport =< 80", []string{"dport", "=", "<", "80"}},
	{"dport << 80", []string{"dport", "<", "<", "80"}},
	{"dport >> 80", []string{"dport", ">", ">", "80"}},
	{"dport => 80", []string{"dport", "=", ">", "80"}},
	{"dport == 80", []string{"dport", "=", "=", "80"}},
	{"blarg != sip ==   yo2a.999.3.7/.2 ", []string{"blarg", "!=", "sip", "=", "=", "yo2a.999.3.7/.2"}},
}

func TestTokenizeConditional(t *testing.T) {
	for _, test := range TokenizeConditionalTests {
		outTokens, err := TokenizeConditional(test.input)
		if err != nil {
			t.Fatalf("TokenizeConditional unexpectedly failed on input %v. The error is: %s",
				test.input, err)
		}
		if !reflect.DeepEqual(test.outTokens, outTokens) {
			t.Fatalf("TokenizeConditional returned an unexpected output. Expected output: %v. Actual output: %s",
				test.outTokens, outTokens)
		}
	}
}

func TestTokenizeConditionalEmpty(t *testing.T) {
	tokens, err := TokenizeConditional("")
	if len(tokens) != 0 || err != nil {
		t.Fatalf("Expected zero length list of tokens and no error. Got: %s, %s", tokens, err)
	}
}

